<script src="https://webapi.amap.com/maps?v=1.4.14&key=67b4b19e0b19792352244afd39397457&plugin=AMap.Autocomplete"></script>
<script type="text/javascript">
  var map = new AMap.Map("container", {
      resizeEnable: true
  });
  var search = document.getElementById("search");
  
  let coords=[];
  let HC = new XMLHttpRequest();
  //为地图注册click事件获取鼠标点击出的经纬度坐标
  map.on('click', function(e) {
    addpoint(e.lnglat.getLat(),e.lnglat.getLng())
  });
  search.addEventListener('keyup',e=>{
    if(e.code==="Enter"&&search.value!==""){
      let url="http://fy.iciba.com/ajax.php?a=fy"+`&auto&t=en-US&w=${search.value}`;
      HC.open('GET',url);
      HC.send();
    }
  })

  HC.onreadystatechange=()=>{
    if(HC.readyState === XMLHttpRequest.DONE && HC.status === 200) {
      let word=JSON.parse(HC.responseText).content.out;
      if(word){ 
        word=word.replace(/^\s+|\s+$/g,"");
        word=word.match(/\w+/g)
        word=word.join('');
        console.log(word);
        let city=cities[word];
        console.log(city);
        addpoint(parseFloat(city[3]),parseFloat(city[4]));
      }
    }
  }

  document.addEventListener('keypress',e=>{
    if(e.ctrlKey&&e.code==="KeyZ"){
      let mark=coords.pop();
      document.getElementById("lnglat").value = coords.map(e=> {return `[${e.coord[0]},${e.coord[1]}]`}).join(",");
      map.remove(mark.marker)
    }
  })

  function addpoint(lat,lng){
    var marker = new AMap.Marker({
      icon: "https://webapi.amap.com/theme/v1.3/markers/n/mark_b.png",
      position: [lng,lat]
    });
    map.add(marker);
    coords.push({coord:[lng,lat],marker:marker})
    document.getElementById("lnglat").value = coords.map(e=> {return `[${e.coord[0]},${e.coord[1]}]`}).join(",");
  }

  var auto = new AMap.Autocomplete({
      input: "tipinput"
  });
  AMap.event.addListener(auto, "select", select);//注册监听，当选中某条记录时会触发
  function select(e) {
      if (e.poi && e.poi.location) {
          map.setZoom(15);
          map.setCenter(e.poi.location);
      }
  }
</script>
